/**
 * @name parsing
 * @author JungHyunKwon
 * @since 2017-12-06
 * @version 1.0.0
 * @param {string} value
 * @param {string} from
 * @param {string} to
 * @param {number} index
 * @return {string}
 */
try{!function(){"use strict";window.parsing=function(n,r,t){var e=[];if("string"==typeof n&&"string"==typeof r&&"string"==typeof t)for(var i=0,o=0,f=0;n.indexOf(r,i)>-1&&(f=(i=n.indexOf(r,i))+r.length,(o=n.indexOf(t,f))>-1);)e.push({value:n.substring(f,o),fromIndex:f,toIndex:o}),i=o+1;return e}}()}catch(n){console.error(n)}